(114, 4, '2018-10-24 10:49:42', '2018-10-24 20:49:42', '<h2>Headings</h2>\n<h1>Header one</h1>\n<h2>Header two</h2>\n<h3>Header three</h3>\n<h4>Header four</h4>\n<h5>Header five</h5>\n<h6>Header six</h6>\n<h2>Blockquotes</h2>\nSingle line blockquote:\n<blockquote>Stay hungry. Stay foolish.</blockquote>\nMulti line blockquote with a cite reference:\n<blockquote>People think focus means saying yes to the thing you\'ve got to focus on. But that\'s not what it means at all. It means saying no to the hundred other good ideas that there are. You have to pick carefully. I\'m actually as proud of the things we haven\'t done as the things I have done. Innovation is saying no to 1,000 things.</blockquote>\n<cite>Steve Jobs</cite> - Apple Worldwide Developers\' Conference, 1997\n<blockquote class=\"alignleft\">Do. Or do not. There is no try.\n\n<cite>Yoda</cite></blockquote>\n<h2>Tables</h2>\n<table>\n<thead>\n<tr>\n<th>Employee</th>\n<th>Salary</th>\n<th></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<th><a href=\"http://example.org/\">John Doe</a></th>\n<td>$1</td>\n<td>Because that\'s all Steve Jobs needed for a salary.</td>\n</tr>\n<tr>\n<th><a href=\"http://example.org/\">Jane Doe</a></th>\n<td>$100K</td>\n<td>For all the blogging she does.</td>\n</tr>\n<tr>\n<th><a href=\"http://example.org/\">Fred Bloggs</a></th>\n<td>$100M</td>\n<td>Pictures are worth a thousand words, right? So Jane x 1,000.</td>\n</tr>\n<tr>\n<th><a href=\"http://example.org/\">Jane Bloggs</a></th>\n<td>$100B</td>\n<td>With hair like that?! Enough said...</td>\n</tr>\n</tbody>\n</table>\n<h2>Definition Lists</h2>\n<dl>\n 	<dt>Definition List Title</dt>\n 	<dd>Definition list division.</dd>\n 	<dt>Startup</dt>\n 	<dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd>\n 	<dt>#dowork</dt>\n 	<dd>Coined by Rob Dyrdek and his personal body guard Christopher \"Big Black\" Boykins, \"Do Work\" works as a self motivator, to motivating your friends.</dd>\n 	<dt>Do It Live</dt>\n 	<dd>I\'ll let Bill O\'Reilly will <a title=\"We\'ll Do It Live\" href=\"https://www.youtube.com/watch?v=O_HyZ5aW76c\">explain</a> this one.</dd>\n</dl>\n<h2>Unordered Lists (Nested)</h2>\n<ul>\n 	<li>List item one\n<ul>\n 	<li>List item one\n<ul>\n 	<li>List item one</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ul>\n</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ul>\n</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ul>\n<h2>Ordered List (Nested)</h2>\n<ol>\n 	<li>List item one\n<ol>\n 	<li>List item one\n<ol>\n 	<li>List item one</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ol>\n</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ol>\n</li>\n 	<li>List item two</li>\n 	<li>List item three</li>\n 	<li>List item four</li>\n</ol>\n<h2>HTML Tags</h2>\nThese supported tags come from the WordPress.com code <a title=\"Code\" href=\"http://en.support.wordpress.com/code/\">FAQ</a>.\n\n<strong>Address Tag</strong>\n\n<address>1 Infinite Loop\nCupertino, CA 95014\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\n\nThis is an example of a <a title=\"Apple\" href=\"http://apple.com\">link</a>.\n\n<strong>Abbreviation Tag</strong>\n\nThe abbreviation <abbr title=\"Seriously\">srsly</abbr> stands for \"seriously\".\n\n<strong>Acronym Tag (<em>deprecated in HTML5</em>)</strong>\n\nThe acronym <acronym title=\"For The Win\">ftw</acronym> stands for \"for the win\".\n\n<strong>Big Tag&nbsp;(<em>deprecated in HTML5</em>)</strong>\n\nThese tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.\n\n<strong>Cite Tag</strong>\n\n\"Code is poetry.\" --<cite>Automattic</cite>\n\n<strong>Code Tag</strong>\n\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\n\n<strong>Delete Tag</strong>\n\nThis tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).\n\n<strong>Emphasize Tag</strong>\n\nThe emphasize tag should <em>italicize</em> text.\n\n<strong>Insert Tag</strong>\n\nThis tag should denote <ins>inserted</ins> text.\n\n<strong>Keyboard Tag</strong>\n\nThis scarcely known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Preformatted Tag</strong>\n\nThis tag styles large blocks of code.\n<pre>.post-title {\n	margin: 0 0 5px;\n	font-weight: bold;\n	font-size: 38px;\n	line-height: 1.2;\n	and here\'s a line of some really, really, really, really long text, just to see how the PRE tag handles it and to find out how it overflows;\n}</pre>\n<strong>Quote Tag</strong>\n\n<q>Developers, developers, developers...</q> --Steve Ballmer\n\n<strong>Strike Tag&nbsp;(<em>deprecated in HTML5</em>)</strong>\n\nThis tag shows strike-through text\n\n<strong>Strong Tag</strong>\n\nThis tag shows <strong>bold text.</strong>\n\n<strong>Subscript Tag</strong>\n\nGetting our science styling on with H<sub>2</sub>O, which should push the \"2\" down.\n\n<strong>Superscript Tag</strong>\n\nStill sticking with science and Isaac Newton\'s E = MC<sup>2</sup>, which should lift the 2 up.\n\n<strong>Teletype Tag&nbsp;(<em>deprecated in HTML5</em>)</strong>\n\nThis rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Variable Tag</strong>\n\nThis allows you to denote <var>variables</var>.', 'Gutenberg: Classic Block', '', 'private', 'open', 'open', '', 'gutenberg-classic-block', '', '', '2021-02-17 23:57:07', '2021-02-17 23:57:07', '', 0, 'https://chrisrunnells.wordpress.com/?p=114', 0, 'post', '', 0),
(116, 4, '2018-10-24 10:59:26', '2018-10-24 20:59:26', '<!-- wp:heading -->\n<h2>Imgur Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:core-embed/imgur {\"url\":\"https://i.imgur.com/nlG3C7A.jpg\",\"type\":\"rich\",\"providerNameSlug\":\"imgur\",\"className\":\"\"} -->\n<figure class=\"wp-block-embed-imgur wp-block-embed is-type-rich is-provider-imgur\"><div class=\"wp-block-embed__wrapper\">\nhttps://i.imgur.com/nlG3C7A.jpg\n</div></figure>\n<!-- /wp:core-embed/imgur -->\n\n<!-- wp:heading -->\n<h2>Embed Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:embed {\"url\":\"https://google.com\"} -->\n<figure class=\"wp-block-embed\"><div class=\"wp-block-embed__wrapper\">\nhttps://google.com\n</div></figure>\n<!-- /wp:embed -->\n\n<!-- wp:heading -->\n<h2>Twitter Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:core-embed/twitter {\"url\":\"https://twitter.com/wordpressdotcom\",\"type\":\"rich\",\"providerNameSlug\":\"twitter\",\"className\":\"\"} -->\n<figure class=\"wp-block-embed-twitter wp-block-embed is-type-rich is-provider-twitter\"><div class=\"wp-block-embed__wrapper\">\nhttps://twitter.com/wordpressdotcom\n</div></figure>\n<!-- /wp:core-embed/twitter -->\n\n<!-- wp:heading -->\n<h2>YouTube Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=xifhQyopjZM\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=xifhQyopjZM\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:heading -->\n<h2>Facebook Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:core-embed/facebook {\"url\":\"https://www.facebook.com/WordPresscom/\",\"className\":\"\"} -->\n<figure class=\"wp-block-embed-facebook wp-block-embed\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.facebook.com/WordPresscom/\n</div></figure>\n<!-- /wp:core-embed/facebook -->\n\n<!-- wp:heading -->\n<h2>Instagram Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:core-embed/instagram {\"url\":\"https://www.instagram.com/rei/\"} -->\n<figure class=\"wp-block-embed-instagram wp-block-embed\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.instagram.com/rei/\n</div></figure>\n<!-- /wp:core-embed/instagram -->\n\n<!-- wp:heading -->\n<h2>WordPress Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:core-embed/wordpress {\"url\":\"https://automattic.design/\"} -->\n<figure class=\"wp-block-embed-wordpress wp-block-embed\"><div class=\"wp-block-embed__wrapper\">\nhttps://automattic.design/\n</div></figure>\n<!-- /wp:core-embed/wordpress -->\n\n<!-- wp:heading -->\n<h2>Soundcloud Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:core-embed/soundcloud {\"url\":\"https://soundcloud.com/monstercat/rameses-b-something-real\",\"type\":\"rich\",\"providerNameSlug\":\"soundcloud\",\"className\":\"wp-embed-aspect-1-1 wp-has-aspect-ratio wp-embed-aspect-4-3\"} -->\n<figure class=\"wp-block-embed-soundcloud wp-block-embed is-type-rich is-provider-soundcloud wp-embed-aspect-1-1 wp-has-aspect-ratio wp-embed-aspect-4-3\"><div class=\"wp-block-embed__wrapper\">\nhttps://soundcloud.com/monstercat/rameses-b-something-real\n</div></figure>\n<!-- /wp:core-embed/soundcloud -->\n\n<!-- wp:heading -->\n<h2>Spotify Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:core-embed/spotify {\"url\":\"https://open.spotify.com/album/3qg7pFyj6gbNVDtbi9aZHY\",\"type\":\"rich\",\"providerNameSlug\":\"spotify\",\"className\":\"wp-embed-aspect-9-16 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-spotify wp-block-embed is-type-rich is-provider-spotify wp-embed-aspect-9-16 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://open.spotify.com/album/3qg7pFyj6gbNVDtbi9aZHY\n</div></figure>\n<!-- /wp:core-embed/spotify -->\n\n<!-- wp:heading -->\n<h2>Flickr Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:core-embed/flickr {\"url\":\"https://www.flickr.com/photos/tom_hall_nz/17004434418/in/gallery-134864050@N04-72157656707819872/\",\"type\":\"photo\",\"providerNameSlug\":\"flickr\",\"className\":\"\"} -->\n<figure class=\"wp-block-embed-flickr wp-block-embed is-type-photo is-provider-flickr\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.flickr.com/photos/tom_hall_nz/17004434418/in/gallery-134864050@N04-72157656707819872/\n</div></figure>\n<!-- /wp:core-embed/flickr -->\n\n<!-- wp:heading -->\n<h2>Vimeo Embed</h2>\n<!-- /wp:heading -->\n\n<!-- wp:core-embed/vimeo {\"url\":\"https://vimeo.com/22439234\",\"type\":\"video\",\"providerNameSlug\":\"vimeo\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-vimeo wp-block-embed is-type-video is-provider-vimeo wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://vimeo.com/22439234\n</div></figure>\n<!-- /wp:core-embed/vimeo -->', 'Gutenberg: Embed Blocks', '', 'private', 'open', 'open', '', 'gutenberg-embed-blocks', '', '', '2021-02-17 23:57:07', '2021-02-17 23:57:07', '', 0, 'https://chrisrunnells.wordpress.com/?p=116', 0, 'post', '', 0),
(122, 4, '2018-10-24 11:24:22', '2018-10-24 21:24:22', '<!-- wp:heading {\"level\":3} -->\n<h3>Code Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>.codeblock {\n    right: 100% !important;\n    position: absolute;\n}</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Classic Block</h3>\n<!-- /wp:heading -->\n\n<p>This is the classic block.</p>\n<p>It\'s using the regular editor.</p>\n\n<!-- wp:heading {\"level\":3} -->\n<h3>HTML Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:html -->\n<p style=\"font-weight:bold;font-size:16px;\">\n	My HTML block.\n</p>\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Preformatted Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\">This is a preformatted block.<br>It is the best block.<br>Amazing.</pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Pullquote Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>This is a pullquote. It\'s pretty awesome.</p><cite>Laurel Fulford</cite></blockquote></figure>\n<!-- /wp:pullquote -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Table Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:table -->\n<figure class=\"wp-block-table\"><table><thead><tr><th>Header 1</th><th>Header 2</th><th>Header 3</th></tr></thead><tbody><tr><td>Bob</td><td>Smith</td><td>36</td></tr><tr><td>Jane</td><td>Doe</td><td>25</td></tr><tr><td>Susan</td><td>Smithers</td><td>34</td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Verse Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:verse -->\n<pre class=\"wp-block-verse\">This is a verse.<br>It apparently has no styles? <br>Amazing.</pre>\n<!-- /wp:verse -->', 'Gutenberg: Formatting Blocks', '', 'publish', 'open', 'open', '', 'gutenberg-formatting-blocks', '', '', '2021-05-03 23:52:14', '2021-05-03 23:52:14', '', 0, 'https://chrisrunnells.wordpress.com/?p=122', 0, 'post', '', 0),
(125, 4, '2018-10-24 11:34:02', '2018-10-24 21:34:02', '<!-- wp:heading {\"level\":3} -->\n<h3>Button Blocks</h3>\n<!-- /wp:heading -->\n\n<!-- wp:button {\"textColor\":\"primary\",\"customBackgroundColor\":\"#ffffff\",\"align\":\"left\"} -->\n<div class=\"wp-block-button alignleft\"><a class=\"wp-block-button__link has-text-color has-primary-color has-background\" href=\"https://www.wordpress.com\" style=\"background-color:#ffffff\">This is a button</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {\"backgroundColor\":\"primary\",\"textColor\":\"background\"} -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link has-text-color has-background-color has-background has-primary-background-color\" href=\"https://www.wordpress.com\" target=\"_blank\" rel=\"noreferrer noopener\">This is a centered button</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {\"align\":\"right\"} -->\n<div class=\"wp-block-button alignright\"><a class=\"wp-block-button__link\" href=\"https://www.wordpress.com\">This is a left button<br></a></div>\n<!-- /wp:button -->\n\n<!-- wp:heading -->\n<h2>File Block</h2>\n<!-- /wp:heading -->\n\n<!-- wp:file {\"id\":104,\"href\":\"http://localhost:8001/wp-content/uploads/2018/10/wordpress-logotype-standard.pdf\"} -->\n<div class=\"wp-block-file\"><a href=\"http://localhost:8001/wp-content/uploads/2018/10/wordpress-logotype-standard.pdf\">WordPress-logotype-standard</a><a href=\"http://localhost:8001/wp-content/uploads/2018/10/wordpress-logotype-standard.pdf\" class=\"wp-block-file__button\" download>Download</a></div>\n<!-- /wp:file -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Spacer <em>Block</em></h3>\n<!-- /wp:heading -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Separator Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The following separators should be a short line, a long line, and some dots.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"color\":\"accent\"} -->\n<hr class=\"wp-block-separator has-text-color has-background has-accent-background-color has-accent-color\"/>\n<!-- /wp:separator -->\n\n<!-- wp:separator {\"customColor\":\"#817b4b\",\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator has-text-color has-background is-style-wide\" style=\"background-color:#817b4b;color:#817b4b\"/>\n<!-- /wp:separator -->\n\n<!-- wp:separator {\"className\":\"is-style-dots\"} -->\n<hr class=\"wp-block-separator is-style-dots\"/>\n<!-- /wp:separator -->', 'Gutenberg: Layout Element Blocks', '', 'publish', 'open', 'open', '', 'gutenberg-layout-element-blocks', '', '', '2021-05-03 23:52:14', '2021-05-03 23:52:14', '', 0, 'https://chrisrunnells.wordpress.com/?p=125', 0, 'post', '', 0),
(128, 4, '2018-10-24 11:54:34', '2018-10-24 21:54:34', '<!-- wp:heading -->\n<h2>2 columns</h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns {\"backgroundColor\":\"primary\",\"textColor\":\"background\",\"className\":\"has-2-columns\"} -->\n<div class=\"wp-block-columns has-background has-text-color has-primary-background-color has-background-color has-2-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":103} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost:8001/wp-content/uploads/2018/10/zoltan-tasi-482489-unsplash.jpg\" alt=\"\" class=\"wp-image-103\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This is a 2-column layout, just trying some things out to see how it goes. Each column should have enough padding to breathe a little bit. Don\'t forget to consider how columns will look on smaller screens. #mobilefirst</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":101} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost:8001/wp-content/uploads/2018/10/jordan-steranka-504707-unsplash.jpg\" alt=\"\" class=\"wp-image-101\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2>3 columns<br></h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns {\"verticalAlignment\":\"center\",\"customBackgroundColor\":\"#ffffff\",\"customTextColor\":\"#373a3c\",\"className\":\"has-3-columns\"} -->\n<div class=\"wp-block-columns has-background has-text-color are-vertically-aligned-center has-3-columns\" style=\"background-color:#ffffff;color:#373a3c\"><!-- wp:column {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\"><!-- wp:image {\"id\":103} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost:8001/wp-content/uploads/2018/10/zoltan-tasi-482489-unsplash.jpg\" alt=\"\" class=\"wp-image-103\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This is a typical 3-column layout with images on top and some text below. </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\"><!-- wp:image {\"id\":96} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost:8001/wp-content/uploads/2018/10/brandon-siu-608784-unsplash.jpg\" alt=\"\" class=\"wp-image-96\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>You\'ll find this layout on web sites all over the internet.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\"><!-- wp:image {\"id\":102} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost:8001/wp-content/uploads/2018/10/kristopher-roller-110203-unsplash.jpg\" alt=\"\" class=\"wp-image-102\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Gutenberg makes this kind of layout easy to build. <em>The future is now!</em></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>second level columns</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>third level columns</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>fourth level columns</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>first level block</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading -->\n<h2>4 columns</h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns {\"className\":\"has-4-columns\"} -->\n<div class=\"wp-block-columns has-4-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>This is the first column, and it\'s amazing. </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>This is the second column, and it\'s also amazing.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>The third column, as they say, is like a charm.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>This is the fourth column, and it\'s possibly the best.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2>5 columns</h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns {\"align\":\"wide\",\"className\":\"has-5-columns\"} -->\n<div class=\"wp-block-columns alignwide has-5-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>5 columns of text in the post, 5 columns of text. Take one down, move it around, 4 columns of text in the post.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>4 columns of text in the post, 4 columns of text. Take one down, move it around, 3 columns of text in the post.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>3 columns of text in the post, 3 columns of text. Take one down, move it around, 2 columns of text in the post.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>2 columns of text in the post, 2 columns of text. Take one down, move it around, 1 columns of text in the post.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>1 column of text in the post, 1 column of text. Take one down, move it around, no columns of text in the post.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator is-style-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2>6 columns</h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns {\"align\":\"full\",\"className\":\"has-6-columns\"} -->\n<div class=\"wp-block-columns alignfull has-6-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":137} -->\n<figure class=\"wp-block-image\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/akismet-logo.png\" alt=\"\" class=\"wp-image-137\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>One column.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":138} -->\n<figure class=\"wp-block-image\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/gravatar.png\" alt=\"\" class=\"wp-image-138\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Two columns.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":139} -->\n<figure class=\"wp-block-image\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/jetpack.png\" alt=\"\" class=\"wp-image-139\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Three columns.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":140} -->\n<figure class=\"wp-block-image\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/logo-cloudup-1.png\" alt=\"\" class=\"wp-image-140\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Four columns.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":148} -->\n<figure class=\"wp-block-image\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/logo-crowdsignal.png\" alt=\"\" class=\"wp-image-148\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Five columns.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":141} -->\n<figure class=\"wp-block-image\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/logo-longreads1.png\" alt=\"\" class=\"wp-image-141\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Six columns.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {\"align\":\"full\",\"className\":\"has-6-columns\"} -->\n<div clas