(11794, 4, '2021-05-03 23:52:14', '2021-05-03 23:52:14', '<!-- wp:heading {\"level\":3} -->\n<h3>Button Blocks</h3>\n<!-- /wp:heading -->\n\n<!-- wp:button {\"textColor\":\"primary\",\"customBackgroundColor\":\"#ffffff\",\"align\":\"left\"} -->\n<div class=\"wp-block-button alignleft\"><a class=\"wp-block-button__link has-text-color has-primary-color has-background\" href=\"https://www.wordpress.com\" style=\"background-color:#ffffff\">This is a button</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {\"backgroundColor\":\"primary\",\"textColor\":\"background\"} -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link has-text-color has-background-color has-background has-primary-background-color\" href=\"https://www.wordpress.com\" target=\"_blank\" rel=\"noreferrer noopener\">This is a centered button</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {\"align\":\"right\"} -->\n<div class=\"wp-block-button alignright\"><a class=\"wp-block-button__link\" href=\"https://www.wordpress.com\">This is a left button<br></a></div>\n<!-- /wp:button -->\n\n<!-- wp:heading -->\n<h2>File Block</h2>\n<!-- /wp:heading -->\n\n<!-- wp:file {\"id\":104,\"href\":\"http://localhost:8001/wp-content/uploads/2018/10/wordpress-logotype-standard.pdf\"} -->\n<div class=\"wp-block-file\"><a href=\"http://localhost:8001/wp-content/uploads/2018/10/wordpress-logotype-standard.pdf\">WordPress-logotype-standard</a><a href=\"http://localhost:8001/wp-content/uploads/2018/10/wordpress-logotype-standard.pdf\" class=\"wp-block-file__button\" download>Download</a></div>\n<!-- /wp:file -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Spacer <em>Block</em></h3>\n<!-- /wp:heading -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Separator Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The following separators should be a short line, a long line, and some dots.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"color\":\"accent\"} -->\n<hr class=\"wp-block-separator has-text-color has-background has-accent-background-color has-accent-color\"/>\n<!-- /wp:separator -->\n\n<!-- wp:separator {\"customColor\":\"#817b4b\",\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator has-text-color has-background is-style-wide\" style=\"background-color:#817b4b;color:#817b4b\"/>\n<!-- /wp:separator -->\n\n<!-- wp:separator {\"className\":\"is-style-dots\"} -->\n<hr class=\"wp-block-separator is-style-dots\"/>\n<!-- /wp:separator -->', 'Gutenberg: Layout Element Blocks', '', 'inherit', 'closed', 'closed', '', '125-revision-v1', '', '', '2021-05-03 23:52:14', '2021-05-03 23:52:14', '', 125, 'http://localhost:8001/2021/05/03/125-revision-v1/', 0, 'revision', '', 0),
(11795, 4, '2021-05-03 23:52:14', '2021-05-03 23:52:14', '{\"action_type\":\"CREATE\",\"title\":\"Gutenberg: Formatting Blocks\",\"node_id\":122,\"relay_id\":\"cG9zdDoxMjI=\",\"graphql_single_name\":\"post\",\"graphql_plural_name\":\"posts\",\"status\":\"publish\"}', 'Gutenberg: Formatting Blocks', '', 'publish', 'closed', 'closed', '', 'gutenberg-formatting-blocks-1620085934', '', '', '2021-05-03 23:52:14', '2021-05-03 23:52:14', '', 0, 'http://localhost:8001/action_monitor/gutenberg-formatting-blocks-1620085934/', 0, 'action_monitor', '', 0),
(11796, 4, '2021-05-03 23:52:14', '2021-05-03 23:52:14', '<!-- wp:heading {\"level\":3} -->\n<h3>Code Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>.codeblock {\n    right: 100% !important;\n    position: absolute;\n}</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Classic Block</h3>\n<!-- /wp:heading -->\n\n<p>This is the classic block.</p>\n<p>It\'s using the regular editor.</p>\n\n<!-- wp:heading {\"level\":3} -->\n<h3>HTML Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:html -->\n<p style=\"font-weight:bold;font-size:16px;\">\n	My HTML block.\n</p>\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Preformatted Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\">This is a preformatted block.<br>It is the best block.<br>Amazing.</pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Pullquote Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:pullquote -->\n<figure class=\"wp-block-pullquote\"><blockquote><p>This is a pullquote. It\'s pretty awesome.</p><cite>Laurel Fulford</cite></blockquote></figure>\n<!-- /wp:pullquote -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Table Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:table -->\n<figure class=\"wp-block-table\"><table><thead><tr><th>Header 1</th><th>Header 2</th><th>Header 3</th></tr></thead><tbody><tr><td>Bob</td><td>Smith</td><td>36</td></tr><tr><td>Jane</td><td>Doe</td><td>25</td></tr><tr><td>Susan</td><td>Smithers</td><td>34</td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Verse Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:verse -->\n<pre class=\"wp-block-verse\">This is a verse.<br>It apparently has no styles? <br>Amazing.</pre>\n<!-- /wp:verse -->', 'Gutenberg: Formatting Blocks', '', 'inherit', 'closed', 'closed', '', '122-revision-v1', '', '', '2021-05-03 23:52:14', '2021-05-03 23:52:14', '', 122, 'http://localhost:8001/2021/05/03/122-revision-v1/', 0, 'revision', '', 0),
(11797, 4, '2021-05-03 23:52:14', '2021-05-03 23:52:14', '{\"action_type\":\"CREATE\",\"title\":\"Gutenberg: Common Blocks\",\"node_id\":94,\"relay_id\":\"cG9zdDo5NA==\",\"graphql_single_name\":\"post\",\"graphql_plural_name\":\"posts\",\"status\":\"publish\"}', 'Gutenberg: Common Blocks', '', 'publish', 'closed', 'closed', '', 'gutenberg-common-blocks-1620085934', '', '', '2021-05-03 23:52:14', '2021-05-03 23:52:14', '', 0, 'http://localhost:8001/action_monitor/gutenberg-common-blocks-1620085934/', 0, 'action_monitor', '', 0),
(11798, 4, '2021-05-03 23:52:14', '2021-05-03 23:52:14', '<!-- wp:heading {\"level\":3} -->\n<h3>Paragraph Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"dropCap\":true} -->\n<p class=\"has-drop-cap\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris purus urna, vulputate at convallis hendrerit, mattis id mi. Nulla mauris justo, sodales vitae sodales nec, fermentum at elit. Proin condimentum risus sed venenatis mollis. Donec auctor euismod sodales. Donec sodales congue metus, sit amet tempor odio maximus in. Ut vestibulum nisl a maximus scelerisque. Donec aliquam eleifend metus, eget iaculis ante vestibulum id. Nulla facilisi. Nullam interdum sagittis accumsan. Phasellus egestas elementum enim nec condimentum. Sed mattis purus odio. Curabitur vehicula rutrum porttitor. Phasellus tempus dui id turpis fermentum, auctor dictum mauris mollis.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>Header 1</h1>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Header 2</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Header 3</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Header 4</h4>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Header 5</h5>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":6} -->\n<h6>Header 6</h6>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Image Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":7748,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost:8001/wp-content/uploads/2020/08/1002-4312x2868-1-1024x681.jpg\" alt=\"\" class=\"wp-image-7748\"/><figcaption>A pretty unicorn</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>List Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>List Item One</li><li>List Item Two</li><li>List Item Three</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li>List Item One</li><li>List Item Two</li><li>List Item Three</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Quote Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>This is a quote block. It\'s aligned to the side at least in the default styles. Pretty darn amazing.</p><cite>Laurel Fulford</cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Large Quote Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:quote {\"className\":\"is-style-large\"} -->\n<blockquote class=\"wp-block-quote is-style-large\"><p>Use the force, Luke.</p><cite>Obi-Wan Kenobi</cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Audio Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:audio {\"id\":10621} -->\n<figure class=\"wp-block-audio\"><audio controls src=\"http://localhost:8001/wp-content/uploads/2020/10/mattmullenweg-interview.mp3\"></audio><figcaption>Tom Raftery interviews Matt Mullenweg and Donncha  Caoimh</figcaption></figure>\n<!-- /wp:audio -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Cover Image Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:cover {\"url\":\"http://localhost:8001/wp-content/uploads/2020/08/1002-4312x2868-1-scaled.jpg\",\"id\":7748,\"focalPoint\":{\"x\":\"0.04\",\"y\":\"0.50\"}} -->\n<div class=\"wp-block-cover has-background-dim\" style=\"background-image:url(http://localhost:8001/wp-content/uploads/2020/08/1002-4312x2868-1-scaled.jpg);background-position:4% 50%\"><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\">This is a cover image block.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>File Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:html -->\n<div class=\"wp-block-file\"><a href=\"http://localhost:8001/wp-content/uploads/2018/10/wordpress-logotype-standard.pdf\">WordPress-logotype-standard</a><a href=\"http://localhost:8001/wp-content/uploads/2018/10/wordpress-logotype-standard.pdf\" class=\"wp-block-file__button\">Download</a></div>\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Video Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:video {\"id\":10627} -->\n<figure class=\"wp-block-video\"><video autoplay controls loop src=\"http://localhost:8001/wp-content/uploads/2020/10/giphy.mp4\"></video><figcaption>Now that\'s a fun animation!</figcaption></figure>\n<!-- /wp:video -->', 'Gutenberg: Common Blocks', '', 'inherit', 'closed', 'closed', '', '94-revision-v1', '', '', '2021-05-03 23:52:14', '2021-05-03 23:52:14', '', 94, 'http://localhost:8001/2021/05/03/94-revision-v1/', 0, 'revision', '', 0),
(11799, 4, '2021-05-03 23:53:08', '2021-05-03 23:53:08', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pia coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost:8001/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Sample Page', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2021-05-03 23:53:08', '2021-05-03 23:53:08', '', 2, 'http://localhost:8001/2021/05/03/2-revision-v1/', 0, 'revision', '', 0),
